import logo from './logo.svg';
import './App.css';
import { Header } from './Components/Header';
import {BrowserRouter,Routes,Route} from "react-router-dom"
import { Footer } from './Components/Footer';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header></Header>
      <Routes>
       <Route path = "/" element={<Footer/>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
